For #EarthDay, ‚ÄúHellscape No 17‚Äù by artist @petra_cortright has been installed at the Cantor Arts Center (@cantorarts) and the @hammer_museum as part of #ACoolMillionCampaign, a public arts initiative for climate awareness led by artists and institutions to expand environmental justice programming and support the conservation of one million acres of land.

‚ÄúI would like to thank a cool million for the opportunity to help protect the beauty which is California‚Äîmy place of birth,‚Äù says Cortright, ‚Äúwhere the landscape means everything to me. i hope the piece can provide a sense of urgency as well as a sense of hope.‚Äù
Curated by @mickimeng and @haleymellin, A Cool Million is a partnership between @forfreedoms @artandclimateaction, #ArtintoAcres, and 14 arts institutions across California to install climate-related artworks on billboards, museum facades, and public spaces. Learn more at acoolmillion.org. 

