Nearly 2000 people participated in a Lobby Day against AB 2223 organized by Capitol Resource Institute (CRI), Real Impact (RI), Calvary Chapel Chino Hills, and California Family Council (CFC) on April 19, 2022. 

After receiving training from CRI President Karen England and Greg Burt from CFC, throngs of people headed to legislative offices to express opposition to AB 2223, a bill decriminalizing infanticide. 

Then at 11 AM, thousands gathered at a press conference on the capitol steps led by RI Director Gina Gleason and CFC President Jonathan Keller.  Speakers included:

- Pastor Jack Hibbs (Calvary Chapel Chino Hills and Founder of Real Impact); 

- Pastor Greg Farrington (Destiny Christian Church, Rocklin); 

- Pastor Jim Franklin (Cornerstone Fresno); 

- Kevin Mcgary, (Every Black Life Matters) 

- Pastor Marc Little, (Cure America Action); 

- Theresa Brennan, (The Right to Life League)

Yesterday was only the beginning. We hope to have even bigger crowds join us for future hearings against AB 2223 and for the California March for Life on June 22. Register here: https://ca.marchforlife.org/

